const gradient={"0.0": "#440154", "0.25": "#414487", "0.50": "#2A788E", "0.75": "#22A884", "1.0": "#7AD151"};
let heat=null;

function update(season){
  if(heat) heat.remove();
  let pts=[];
  if(season==="All") {
    for(const s in data) pts=pts.concat(data[s]);
  } else {
    pts=data[season]||[];
  }
  if(!pts.length) return;
  heat=L.heatLayer(pts,{radius:25,blur:15,minOpacity:0.35,gradient:gradient}).addTo(map);
  const lats=pts.map(p=>p[0]), lons=pts.map(p=>p[1]);
  map.fitBounds([[Math.min(...lats),Math.min(...lons)],[Math.max(...lats),Math.max(...lons)]]);
}

document.getElementById('seasonSelect').addEventListener('change',e=>update(e.target.value));
update("All");

const legend=L.control({position:'bottomright'});
legend.onAdd=function(){
  const div=L.DomUtil.create('div','info legend');
  div.innerHTML += '<div class="legend-gradient"></div>';
  div.innerHTML += '<div style="display:flex;justify-content:space-between;width:200px;">' +
                   '<span>Low</span><span>Med</span><span>High</span><span>Very High</span></div>';
  return div;
};
legend.addTo(map);
</script>
